/*Table structure for table `import_stock` */

DROP TABLE IF EXISTS `import_stock`;

CREATE TABLE `import_stock` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `typeBrand` varchar(10) DEFAULT NULL COMMENT '品牌种类',
  `category` varchar(20) DEFAULT NULL COMMENT '类别',
  `patternno` varchar(20) DEFAULT NULL COMMENT '编号（花型）',
  `grades` varchar(10) DEFAULT NULL COMMENT '等级',
  `color` varchar(10) DEFAULT NULL COMMENT '色号',
  `warehouse` varchar(10) DEFAULT NULL COMMENT '库位',
  `stock` varchar(10) DEFAULT '0' COMMENT '库存量（Excel里的库存-当天开票=系统库存+冻结）',
  `currentStock` int(10) DEFAULT '0' COMMENT '系统里的库存',
  `freezeStock` int(10) DEFAULT '0' COMMENT '对应的冻结量',
  `todayBillStock` int(10) DEFAULT '0' COMMENT '当天对应开票的总量',
  `wareStock` int(10) DEFAULT '0' COMMENT '入库总库存',
  `stockId` int(10) DEFAULT '0' COMMENT '对应的库存ID',
  `pId` int(10) DEFAULT '0' COMMENT '对应的产品ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1739 DEFAULT CHARSET=utf8;

