/*Table structure for table `local_stock` */

DROP TABLE IF EXISTS `local_stock`;

CREATE TABLE `local_stock` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `pId` int(10) DEFAULT '0',
  `stockId` int(10) DEFAULT '0' COMMENT '对应的库存ID',
  `warehouse` varchar(10) DEFAULT NULL COMMENT '库位',
  `currentStock` int(10) DEFAULT '0' COMMENT '系统里的库存',
  `freezeStock` int(10) DEFAULT '0' COMMENT '对应的冻结量',
  `billStock` int(10) DEFAULT '0' COMMENT '对应开票的总量',
  `wareStock` int(10) DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=794 DEFAULT CHARSET=utf8;

