/*Table structure for table `mat_stock_record` */

DROP TABLE IF EXISTS `mat_stock_record`;

CREATE TABLE `mat_stock_record` (
  `RECORD_ID` int(7) unsigned NOT NULL AUTO_INCREMENT,
  `SUPPLIER_ID` int(10) DEFAULT NULL COMMENT '供销商ID',
  `IS_PRINT` tinyint(1) DEFAULT '0' COMMENT '是否打印',
  `SUB_COUNT` int(9) DEFAULT '0' COMMENT '子记录数 检查审阅状态',
  `TOTAL_PRICE` decimal(10,2) DEFAULT NULL COMMENT '总价',
  `STATE` int(1) DEFAULT '3' COMMENT '0等待验收 1验收通过 2验收驳回 3等待填入价格 4等待审核 5通过 6驳回',
  `CREATER` varchar(50) DEFAULT NULL COMMENT '创建人',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '创建日期',
  `VALID` tinyint(1) DEFAULT '1' COMMENT '删除后',
  `CHECK_COUNT` int(11) DEFAULT '0' COMMENT '记录需要化验的条数',
  `MAT_ID` int(11) DEFAULT NULL COMMENT '三大种类不会混合',
  PRIMARY KEY (`RECORD_ID`),
  KEY `MAT_ID` (`MAT_ID`),
  KEY `STATE` (`STATE`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

