  `CREATE_DATE` datetime DEFAULT NULL COMMENT '统计时间',
  `INVENTORY` int(9) DEFAULT '0' COMMENT '盘盈盘亏',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

