/*Table structure for table `xly_statistics_stock_1` */

DROP TABLE IF EXISTS `xly_statistics_stock_1`;

CREATE TABLE `xly_statistics_stock_1` (
  `ID` int(9) NOT NULL AUTO_INCREMENT,
  `TYPE_ID` int(9) DEFAULT NULL COMMENT '种类ID',
  `GRADES_ID` int(9) DEFAULT NULL COMMENT '等级ID',
  `YC_STOCK` int(9) DEFAULT NULL COMMENT '月初库存 中文拼音',
  `YM_STOCK` int(9) DEFAULT NULL COMMENT '月末库存 中文拼音',
  `SALES_VOLUME` int(11) DEFAULT NULL COMMENT '销量（去除样品）',
  `OUT_PUT` int(9) DEFAULT NULL COMMENT '产量（根据入库的生产日期） 只取正常入库',
  `DAMAGED` int(9) DEFAULT NULL COMMENT '破损量',
  `SAMPLE` int(9) DEFAULT NULL COMMENT '发出样品量',
  `ADJUSTMENT` int(9) DEFAULT NULL COMMENT '调账（减少库存  减去  增加库存）',
  `STATISTIC_MONTH` varchar(7) DEFAULT NULL COMMENT '统计月',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '统计时间',
  `INVENTORY` int(9) DEFAULT '0' COMMENT '盘盈盘亏',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM AUTO_INCREMENT=43 DEFAULT CHARSET=utf8;

