  `ID` int(10) NOT NULL AUTO_INCREMENT,
  `WAREHOUSE` varchar(10) NOT NULL,
  `PRODUCT_ID` int(5) NOT NULL,
  `STOCK` int(10) NOT NULL DEFAULT '0',
